import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Legend, defs, linearGradient, stop } from 'recharts';

const monthWiseLeads = [
  { month: 'Jan', leads: 30 },
  { month: 'Feb', leads: 45 },
  { month: 'Mar', leads: 60 },
  { month: 'Apr', leads: 50 },
  { month: 'May', leads: 80 },
  { month: 'Jun', leads: 65 },
  { month: 'Jul', leads: 90 },
  { month: 'Aug', leads: 70 },
  { month: 'Sep', leads: 55 },
  { month: 'Oct', leads: 75 },
  { month: 'Nov', leads: 60 },
  { month: 'Dec', leads: 85 },
];

const dailyLeads = [
  { date: '2024-06-01', leads: 5 },
  { date: '2024-06-02', leads: 8 },
  { date: '2024-06-03', leads: 6 },
  { date: '2024-06-04', leads: 10 },
  { date: '2024-06-05', leads: 7 },
];

function getDayOfWeek(dateString: string) {
  const days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
  const date = new Date(dateString);
  return days[date.getDay()];
}

const CustomTooltip = ({ active, payload, label }: any) => {
  if (active && payload && payload.length) {
    return (
      <div className="bg-white p-3 rounded shadow border border-gray-200">
        <p className="font-semibold text-primary-600">{label}</p>
        <p className="text-sm">Leads: <span className="font-bold">{payload[0].value}</span></p>
      </div>
    );
  }
  return null;
};

const Leads: React.FC = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Leads</h1>
      <div className="mb-8 bg-white p-4 rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Month-wise Leads</h2>
        <ResponsiveContainer width="100%" height={320}>
          <LineChart data={monthWiseLeads} margin={{ top: 20, right: 30, left: 0, bottom: 0 }}>
            <defs>
              <linearGradient id="colorLeads" x1="0" y1="0" x2="0" y2="1">
                <stop offset="0%" stopColor="#6366f1" stopOpacity={0.8}/>
                <stop offset="100%" stopColor="#a5b4fc" stopOpacity={0.2}/>
              </linearGradient>
            </defs>
            <CartesianGrid strokeDasharray="3 3" stroke="#e5e7eb" />
            <XAxis dataKey="month" tick={{ fill: '#6366f1', fontWeight: 500 }} axisLine={{ stroke: '#6366f1' }} />
            <YAxis tick={{ fill: '#6366f1', fontWeight: 500 }} axisLine={{ stroke: '#6366f1' }} />
            <Tooltip content={<CustomTooltip />} />
            <Legend verticalAlign="top" height={36} iconType="circle" wrapperStyle={{ color: '#6366f1' }} />
            <Line type="monotone" dataKey="leads" stroke="url(#colorLeads)" strokeWidth={3} dot={{ r: 6, fill: '#6366f1', stroke: '#fff', strokeWidth: 2 }} activeDot={{ r: 8 }} />
          </LineChart>
        </ResponsiveContainer>
      </div>
      <div className="bg-white p-4 rounded shadow">
        <h2 className="text-lg font-semibold mb-2">Daily Leads</h2>
        <table className="min-w-full divide-y divide-gray-200">
          <thead>
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Date</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Day</th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">No of Leads</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {dailyLeads.map((row, idx) => (
              <tr key={idx}>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{row.date}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{getDayOfWeek(row.date)}</td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-700">{row.leads}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Leads;
